"text": "<div>\n<i class=\"NoteType\">\nTapahtuman lis\u00e4tietoja\n</i>\n<div class=\"grampsstylednote\">\n<p>\nKasteluettelon mukaan 26.9.1781 syntyi ja 1.10.1781 kastettiin Henric Henricsson f\u00f6dd i Hulipas, fadren b. Henric Johansson, modren hu Maria Andersdr. Kasteluettelo vastaa huonosti rippikirjaa. J\u00e4\u00e4 ep\u00e4selv\u00e4ksi, onko kasteluettelossa lapsen nimi oikea vai v\u00e4\u00e4r\u00e4, kastettiinko silloin Simon vai h\u00e4nen isoveljens\u00e4 Henric, koska ei l\u00f6ytynyt kastetta isoveljelle joka on rippikirjan mukaan syntynyt 8. tammikuuta 1779.\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
